INSERT INTO Vacunas VALUES("CV19","SARS-CoV-2","Las vacunas contra el SARS-CoV-2 (COVID-19) basadas en vectores de adenovirus son seguras");
INSERT INTO Vacunas VALUES("DTPa","Difteria","Hay dos vacunas que ayudan a proteger a los niños contra la difteria: la DTaP y la Tdap.");
INSERT INTO Vacunas VALUES("GR","Gripe","La vacuna para la gripe hace que el cuerpo genere anticuerpos contra el virus de la influenza.");
INSERT INTO Vacunas VALUES("HB","Hepatitis B","La infección aguda por hepatitis B es una afección de corto plazo que puede causar fiebre, fatiga...");
INSERT INTO Vacunas VALUES("Hib","Haemophilus","Es un género de bacterias Gram negativas con forma de cocobacilos pero muy pleomórficas.");
INSERT INTO Vacunas VALUES("MNC","Menincococo","La vacuna antimeningocócica conjugada tetravalente (ACYW) protege contra la Enfermedad Meningocócica Invasiva (EMI) y sus complicaciones. ");
INSERT INTO Vacunas VALUES("TV","Triple Vírica","Por lo general se administra a niños y niñas de aproximadamente un año de edad, con un refuerzo antes de comenzar la edad preescolar.");
INSERT INTO Vacunas VALUES("VNC","Neumococo","La vacuna antineumocócica polisacárida (PPSV23 o Pneumovax®) protege contra 23 tipos de bacterias neumocócicas.");
INSERT INTO Vacunas VALUES("VPH","Papiloma Virus","En la actualidad hay tres vacunas en el mercado, Gardasil, Cervarix y Gardasil 9.");
INSERT INTO Vacunas VALUES("VPI","Poleomielitis","La vacuna Salk contra la poliomielitis consiste en una dosis inyectada de poliovirus inactivados o muertos (IPV).");
INSERT INTO Vacunas VALUES("VVZ","Varicela","Los niños de 12 meses hasta los 12 años de edad deben recibir 2 dosis de la vacuna contra la varicela.");
